import { useState } from 'react'
import {Radio, RadioGroup } from '@headlessui/react'
import { CheckIcon, XMarkIcon as XMarkIconMini } from '@heroicons/react/20/solid'
import AOS from 'aos';
import 'aos/dist/aos.css';

AOS.init({
    duration: 500,
    once: true,
    });

export default function Social() {

  return (
  <div className="flex flex-col items-center justify-center w-full mt-4 text-white h-70vh" id="social-section">
    <h1 className='text-4xl font-bold' data-aos="fade-up">Nuestras Redes</h1>
  </div>
  )
}
